import './App.css';
import { Route } from 'react-router-dom';
import About from './Pages/about';
import HomePage from './Pages/homepg';
import Projects from './Pages/projects';


function App() {
  return (
    <div>
      <Switch>

      <Route path='/'>
          <HomePage/>
        </Route>

        <Route path='/about'>
          <About/>
        </Route>

        <Route path='/proj'>
          <Projects/>
        </Route>

      </Switch>

    </div>
  );
}

export default App;
